import React from 'react';

const ChatIcon = ({ className, width = 20, height = 20 }) => (
  <svg 
    className={`chat-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 20 20"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path 
      d="M18 10C18 14.4183 14.4183 18 10 18C8.35 18 6.8 17.5 5.5 16.6L2 18L3.4 14.5C2.5 13.2 2 11.65 2 10C2 5.58172 5.58172 2 10 2C14.4183 2 18 5.58172 18 10Z" 
      stroke="currentColor" 
      strokeWidth="2" 
      strokeLinecap="round" 
      strokeLinejoin="round"
    />
  </svg>
);

export default ChatIcon;
